import React from 'react';
import StocksList from './StocksList';
import MarketWatch from './MarketWatch';
import NavBar from './NavBar';
import { Navigate } from 'react-router-dom';

export default function UserDashboard({ currentUser, logout }) {

  if (!currentUser || !currentUser.username) {

    return <Navigate to="/" replace />;
  }


  function UserDashboard({ currentUser, logout }) {
    return (
      <div className='user-details'>
        <NavBar currentUser={currentUser.toUpperCase()} logout={logout} />
        <h2>{currentUser.username.toUpperCase()}'s User Dashboard</h2>
        <StocksList />
        <MarketWatch />
      </div>
    );
  }



}
